// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract SQLQueryContract {
    struct Query {
        string userId;
        string sqlQuery;
        string ipfsCID;
    }

    mapping(uint256 => Query) public queries;
    uint256 public queryCount;

    event QuerySubmitted(
        uint256 indexed queryId,
        string userId,
        string sqlQuery
    );

    event QueryIPFSCIDUpdated(
        uint256 indexed queryId,
        string ipfsCID
    );

    function submitQuery(
        string memory _userId,
        string memory _sqlQuery
    ) external {
        queryCount++;
        queries[queryCount] = Query(_userId, _sqlQuery, "");
        emit QuerySubmitted(queryCount, _userId, _sqlQuery);
    }

    function updateQueryIPFSCID(uint256 _queryId, string memory _ipfsCID) external {
        require(_queryId > 0 && _queryId <= queryCount, "Invalid query ID");
        Query storage query = queries[_queryId];
        query.ipfsCID = _ipfsCID;
        emit QueryIPFSCIDUpdated(_queryId, _ipfsCID);
    }

    function getQueryCID(uint256 _queryId) external view returns (string memory) {
        require(_queryId > 0 && _queryId <= queryCount, "Invalid query ID");
        return queries[_queryId].ipfsCID;
    }

    function getQueryIPFSLink(uint256 _queryId) external view returns (string memory) {
        require(_queryId > 0 && _queryId <= queryCount, "Invalid query ID");
        return string(abi.encodePacked("https://ipfs.io/ipfs/", queries[_queryId].ipfsCID));
    }
}

